import React from 'react';
import './App.css';
import Person from './Person/Person';

function App() {
  return (
    <div className="App">
      <h1>Hi i'm foush</h1>
      <Person name="foush" age="24">
      <h1>Hi There 1</h1>
      </Person>
      <Person name="ibrahiam" age="13">
      <h1>Hi There 2</h1>

      </Person>
      <Person name="Ali" age="25">
      <h1>Hi There 3</h1>

      </Person>

    </div>
  );
}

export default App;
